import { handleBreakpoints } from '@mui/system';
import { useState } from 'react';
import { useParams } from 'react-router-dom';
import PlayerList from './components/PlayerList';
import FeatureButton from './features/FeatureButton';
import GamemodePanel from './features/panels/GamemodePanel';
import OperatorPanel from './features/panels/OperatorPanel';
import './PlayerControllerPageStyling.scss';

function PlayerControllerPage(){
    const { serverid } = useParams();
    const [loadedPanel, setLoadedPanel] = useState(OperatorPanel);

    function handleClick(panelName: any) {
        setLoadedPanel(panelName);
    }
    
    return (
        <div className="controller-container">
            <div className="controller-players">
                <PlayerList serverID={serverid} />
            </div>
            <div className="controller-features">
                <FeatureButton title='Operator' description="Instellingen voor het beheren van de operator status van de speler" onClick={() => handleClick(OperatorPanel)} />
                <FeatureButton title='Gamemode' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Crash' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Kick' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Teleport' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Whitelist' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Clear Inventory' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Kill' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Ban' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Private Message Spam' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Leaken' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Irriteren' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Speler Data' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Inventory' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Money' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Experience' onClick={() => handleClick(GamemodePanel)} />
                <FeatureButton title='Auto Kicker' onClick={() => handleClick(GamemodePanel)} />
            </div>
            <div className="controller-panel">
                {loadedPanel}
            </div>
        </div>
    );
}
export default PlayerControllerPage;
